import { Item } from '../../../../domain/item';

export const testItem: Item = {
  id: 'testId',
  title: 'testTitle',
  price: {
    currency: 'JPY',
    amount: 1000,
    decimals: 56,
  },
  picture: 'https://via.placeholder.com/180',
  condition: 'new',
  free_shipping: true,
};
